import React from 'react';
import {
    GalleryContainer,
    ImageContainer,
    Image,
    Division,
} from './styles'

type Props = {
    images: string[]
}

export const Gallery = ({ images } : Props ) => {
    return (
        <Division>
            <GalleryContainer>
                {images.map((imageUrl, index) => (
                    <ImageContainer key={index}>
                        <Image src={`img/images/${imageUrl}`} alt={`Gallery Image ${index}`} />
                    </ImageContainer>
                ))}
            </GalleryContainer>
        </Division>
    );
};
